{
  "application": "navier_stokes",
  "details": {
    "environment": {
      "bashrc": "~/.bashrc",
      "gcc-glibc": "11",
      "dealii": ""
    },
    "resources": {
      "nodes": 1,
      "cores_per_node": 20,
      "walltime": "12:00:00",
      "queue": "gigat",
      "job_name": "simple_amg_20"
    },
    "mpi": {
      "machinefile": "mpd.nodes",
      "processes": 20,
      "processes_per_node": 20
    },
    "arguments": {
      "T": "0.001",
      "t": "0.001",
      "m": "../mesh/3d-flow-0.05.msh",
      "P": 2,
      "p": 2
    },
    "output_file": "simple_amg_20.out"
  }
}
```

This JSON output provides a structured representation of the script's information:

* **application**: The main executable being run is "navier_stokes".
* **details**: This section breaks down the script's components:
    * **environment**: Modules and environment variables used.
    * **resources**:  The resources requested from the PBS system.
    * **mpi**:  MPI-related configuration, including machinefile creation and execution parameters.
    * **arguments**:  The arguments passed to the "navier_stokes" executable.
    * **output_file**:  The file where the simulation's output is directed.
